// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

contract UserRegistry {
    struct User {
        bytes32 usernameHash; // Store username as hash to save gas
        bytes32 passwordHash;
    }

    mapping(address => User) private users;

    event UserRegistered(address indexed userAddress, bytes32 usernameHash);

    function register(string memory _username, string memory _password) public {
        require(users[msg.sender].usernameHash == 0, "User already registered");

        bytes32 usernameHash = keccak256(abi.encodePacked(_username));
        bytes32 passwordHash = keccak256(abi.encodePacked(_password));

        users[msg.sender] = User({
            usernameHash: usernameHash,
            passwordHash: passwordHash
        });

        emit UserRegistered(msg.sender, usernameHash);
    }

    function getUsername(address _userAddress) public view returns (string memory) {
        require(users[_userAddress].usernameHash != 0, "User not registered");
        return bytes32ToString(users[_userAddress].usernameHash);
    }

    function checkPassword(string memory _password) public view returns (bool) {
        require(users[msg.sender].usernameHash != 0, "User not registered");

        bytes32 passwordHash = keccak256(abi.encodePacked(_password));
        return users[msg.sender].passwordHash == passwordHash;
    }

    function bytes32ToString(bytes32 _bytes32) private pure returns (string memory) {
        uint8 i = 0;
        while(i < 32 && _bytes32[i] != 0) {
            i++;
        }
        bytes memory bytesArray = new bytes(i);
        for (i = 0; i < 32 && _bytes32[i] != 0; i++) {
            bytesArray[i] = _bytes32[i];
        }
        return string(bytesArray);
    }
}

